CREATE DEFINER=`root`@`localhost` PROCEDURE `InterestCalculationV2` ()  BEGIN
	

    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    SELECT        (SELECT investor_acc_number from Investors where dbo.Investors.investor_id = dbo.Investments.investor_id) AS InvestorNumber, 
						(SELECT (investor_name + investor_surname) AS InvestorName from Investors where dbo.Investors.investor_id = dbo.Investments.investor_id) AS InvestorName,
					(SELECT opportunity_code from Opportunities where dbo.Opportunities.opportunity_id = dbo.Investments.opportunity_id) AS OpportunityCode,
					(SELECT opportunity_name from Opportunities where dbo.Opportunities.opportunity_id = dbo.Investments.opportunity_id) AS OpportunityName,
					release_date, end_date, investment_amount, investment_interest_rate, 
					ROUND(investment_amount * TIMESTAMPDIFF(day, release_date, 
                         end_date) / 365 * investment_interest_rate / 100, 2) AS ExpectedInterest, 
						 TIMESTAMPDIFF(day, release_date, end_date) AS StartEndDays, 
                         ROUND(investment_amount * TIMESTAMPDIFF(day, release_date, IIF(end_date > NOW(3),NOW(3), end_date)) / 365 * investment_interest_rate / 100, 2) AS CurrentInterest, 
						 TIMESTAMPDIFF(day, release_date, IIF(end_date > NOW(3), NOW(3), end_date)) 
                         AS CurrentDays
	FROM            Investments
WHERE transaction_type != 3;


END$$

