CREATE DEFINER=`root`@`localhost` PROCEDURE `spCalculateBalances_Investments` ()  BEGIN
	

	DELETE FROM dbo.InvestmentStatement;

		SELECT investor_id, opportunity_id, Date, InvestmentAmount, InterestAmount, Amount, Status, Type, InterestRate, Days FROM (
		 
			SELECT        investor_id, opportunity_id, release_date AS Date, investment_amount AS Amount, investment_amount AS InvestmentAmount, NULL AS InterestAmount, 'T' AS Status, 'T' AS Type, investment_interest_rate AS InterestRate, '' AS Days 
			FROM            Investments
			WHERE NOT transaction_type = 6 AND blocked = 0

			UNION ALL

			--  SQLINES DEMO *** (100) PERCENT investor_id, opportunity_id, EOMONTH(interest_date) AS Date, SUM(interest_amount) AS Amount, 'I' AS Type
			--  SQLINES DEMO *** o.InvestmentInterest
			--  SQLINES DEMO *** id, opportunity_id, EOMONTH(interest_date)

			SELECT investor_id, opportunity_id, EOMONTH(interest_date) AS Date, SUM(interest_amount) AS Amount, NULL AS InvestmentAmount, SUM(interest_amount) AS InterestAmount, 'T' AS Status, 'TI' AS Type, investment_interest_rate AS InterestRate, COUNT(interest_amount) AS Days 
			FROM  InvestmentInterest
			WHERE interest_amount <> 0 AND interest_type = 'T'
			GROUP BY investor_id, opportunity_id, EOMONTH(interest_date), investment_interest_rate

			ORDER BY investor_id, Date) AS tbl

		ORDER BY investor_id, Date
		LIMIT 100;


	--  SQLINES DEMO *** ERCENT investor_id, Date, Amount, Type, SUM(Amount) OVER (PARTITION BY investor_id Order By id) AS Balance
	--  SQLINES DEMO *** tStatement
	--  SQLINES DEMO *** id, Date


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spCalculateBalances_Pledges` ()  BEGIN
	

		SELECT investor_id, opportunity_id, Date, InvestmentAmount, InterestAmount, Amount, Status, Type, InterestRate, Days FROM (
		 
			SELECT        investor_id, opportunity_id, deposit_date AS Date, investment_amount AS Amount, investment_amount AS InvestmentAmount, NULL AS InterestAmount, 'P' AS Status, 'P' AS Type, trust_interest_rate AS InterestRate, '' AS Days 
			FROM            InvestPledges
			WHERE blocked = 0

			UNION ALL

			--  SQLINES DEMO *** (100) PERCENT investor_id, opportunity_id, EOMONTH(interest_date) AS Date, SUM(interest_amount) AS Amount, 'I' AS Type
			--  SQLINES DEMO *** o.InvestmentInterest
			--  SQLINES DEMO *** id, opportunity_id, EOMONTH(interest_date)

			SELECT investor_id, opportunity_id, EOMONTH(interest_date) AS Date, SUM(interest_amount) AS Amount, NULL AS InvestmentAmount, SUM(interest_amount) AS InterestAmount, 'P' AS Status, 'PI' AS Type, investment_interest_rate AS InterestRate, COUNT(interest_amount) AS Days 
			FROM  InvestmentInterest
			WHERE interest_amount <> 0 AND interest_type = 'P'
			GROUP BY investor_id, opportunity_id, EOMONTH(interest_date), investment_interest_rate

			ORDER BY investor_id, Date) AS tbl

		ORDER BY investor_id, Date
		LIMIT 100;


	--  SQLINES DEMO *** ERCENT investor_id, Date, Amount, Type, SUM(Amount) OVER (PARTITION BY investor_id Order By id) AS Balance
	--  SQLINES DEMO *** tStatement
	--  SQLINES DEMO *** id, Date


END$$

