CREATE DEFINER=`root`@`localhost` PROCEDURE `spGenerateInvestorReport` ()  BEGIN


	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT DISTINCT 
	  op.opportunity_code, 
	  iv.investor_id,
	  SUBSTRING(op.opportunity_code,2,Char_length(rtrim(op.opportunity_code))) as UnitNo,
	  SUBSTRING(op.opportunity_code,2,1)	        as Block,
	  i.investor_acc_number					 as InvestorCode,
	  concat(i.investor_name , ' ' , i.investor_surname) as Investor,
	  'FromLoanAgreement'					  as LAEmailDate,
	  p.contract_signed_date				   as LASignDate,
	  'PledgeAmount'					   as PledgeToBePaid,

	  iv.investment_amount				 as InvestmentAmount,
	  
	  iv.dateCreated				 as InvestmentDateCreated,
	  p.deposit_date				 as InvestmentDepositPaid,
	  p.investment_amount				 	 as QuinateAmount,
	  op.opportunity_amount_required	     as UnitTotalCost,
	  p.release_date						   as QuinateDate,
	  p.trust_interest_rate				 as TrustInterestRate,
	  iv.investment_interest_rate	as InvestmentInterestRate
	  

	FROM Investors i
	JOIN Investments iv   on iv.investor_id = i.investor_id
	JOIN Opportunities op on op.opportunity_id = iv.opportunity_id
	JOIN InvestPledges p  on p.investor_id = i.investor_id 
	                         and p.opportunity_id = op.opportunity_id
	--  SQLINES DEMO *** tInterest ii on ii.investor_id = iv.investor_id and ii.opportunity_id = op.opportunity_id
	WHERE p.contract_signed_date IS NOT NULL
	ORDER BY UnitNo, Block;

END$$

